import React from 'react'

function SellerCard( {seller} ) {
    return (
        <div className="ui card"> 
        <img src={seller.image} className="ui small centered image"/>
        <h3 className="ui header">{seller.name}</h3>
        </div>
    )
}

export default SellerCard
